SnippetCode.val:
using System;
using System.IO;
using System.Linq;
using DocumentFormat.OpenXml.Packaging;
using DocumentFormat.OpenXml.Wordprocessing;
using DocumentFormat.OpenXml.Office2013.Word;

public static class Snippet
{
	public static System.String func(System.String myVorlage, System.String myNeueDatei, System.String myFelder)
	{
		string[] felder;
		felder = myFelder.Split('~');		
		byte[] templateBytes = System.IO.File.ReadAllBytes(myVorlage);
		using (MemoryStream templateStream = new MemoryStream())	
		{
			templateStream.Write(templateBytes, 0, (int)templateBytes.Length);
			using (WordprocessingDocument theDoc = WordprocessingDocument.Open(templateStream, true))
			{
				MainDocumentPart mainPart = theDoc.MainDocumentPart;			

				foreach (SdtElement sdt in mainPart.Document.Descendants<SdtElement>().ToList())
				{
				    SdtRepeatedSection rpt = sdt.Descendants<SdtRepeatedSection>().FirstOrDefault();    
					if (rpt!=null) 
					{
						//repeated section
					}
					else
					{
					string type = sdt.GetType().Name;
                    SdtAlias alias = sdt.Descendants<SdtAlias>().FirstOrDefault();
					Text thistext = sdt.Descendants<Text>().FirstOrDefault();
                    if (alias != null)
                        {
							string sdtTitle = alias.Val.Value;
							switch (sdtTitle)
                            {
                                case "Name1":
                                    for (int i=1; i< felder.Length+1; i++) 
									 {
										if (felder[i-1].Split('|')[0]=="Name1") 
										 { 
											thistext.Text=felder[i-1].Split('|')[1];
											break;
										 };
									};
                                    break;
                                case "Name2":
                                    for (int i=1; i< felder.Length+1; i++) 
									 {
										if (felder[i-1].Split('|')[0]=="Name2") 
										 { 
											thistext.Text=felder[i-1].Split('|')[1];
											break;
										};
									};
                                    break;
                                case "Name3":
                                    for (int i=1; i< felder.Length+1; i++) 
									 {
										if (felder[i-1].Split('|')[0]=="Name3") 
										 { 
											thistext.Text=felder[i-1].Split('|')[1];
											break;
										};
									};
                                    break;
                                case "Strasse":
                                    for (int i=1; i< felder.Length+1; i++) 
									 {
										if (felder[i-1].Split('|')[0]=="Strasse") 
										 { 
											thistext.Text=felder[i-1].Split('|')[1];
											break;
										};
									};
                                    break;
                                case "PLZ":
                                    for (int i=1; i< felder.Length+1; i++) 
									 {
										if (felder[i-1].Split('|')[0]=="PLZ") 
										 { 
											thistext.Text=felder[i-1].Split('|')[1];
											break;
										};
									};
                                    break;
								case "Ort":
                                    for (int i=1; i< felder.Length+1; i++) 
									 {
										if (felder[i-1].Split('|')[0]=="Ort") 
										 { 
											thistext.Text=felder[i-1].Split('|')[1];
											break;
										};
									};
									break;
                            }
                        }
					}
				}
			}
			FileStream newfile = new FileStream(myNeueDatei, FileMode.Create);
            templateStream.WriteTo(newfile);
            newfile.Close();
			return "done";
		}
	}
}
